import React, { Component } from 'react';
import {Link} from 'react-router-dom';
import Footer from './Footer';
import Calendar from '../assets/js/Calendar';
import jsPDF from 'jspdf';
import moment from 'moment';

    class Admin extends Component {

      componentDidMount() {
        // Auto initialize all the things!
             M.AutoInit();
        } 
      constructor() {
        super();
        this.state = {
          Nombre: '',
          Cedula: '',
          Telefono: '',
          Email: '',
          Servicio:'',
          Estatus:'',
          Fecha: moment().format('L'),
          _id: '',
          tasks: []       
        };
        this.handleChange = this.handleChange.bind(this);
        this.addTask = this.addTask.bind(this);   
        
        
      }
     
      handleChange(e) {
        const { name, value } = e.target;
        this.setState({
          [name]: value
        });
      }

      addTask(e) {
        e.preventDefault();
        if(this.state._id) {
          fetch(`/api/tasks/${this.state._id}`, {
            method: 'PUT',
            body: JSON.stringify({
              Nombre: this.state.Nombre,
              Cedula: this.state.Cedula,
              Telefono: this.state.Telefono,
              Email: this.state.Email,
              Servicio: this.state.Servicio,
              Estatus:this.state.Estatus,
              Fecha: this.state.Fecha
         
    
            }),
            headers: {
              'Accept': 'application/json',
              'Content-Type': 'application/json'
            }
          })
            .then(res => res.json())
            .then(data => {
              window.M.toast({html: 'Solicitud Actualizada'});
              this.setState({_id: '', Nombre: '', Cedula: '', Telefono: '', Email: '', Servicio:'',Estatus:'', Fecha:''});
              this.fetchTasks();
            });
        } else {
          fetch('/api/tasks', {
            method: 'POST',
            body: JSON.stringify(this.state),
            headers: {
              'Accept': 'application/json',
              'Content-Type': 'application/json'
            }
          })
            .then(res => res.json())
            .then(data => {
              console.log(data);
              window.M.toast({html: 'Solicitud realizada con exito'});
              this.setState({Nombre: '', Cedula: '', Telefono: '', Email: '', Servicio:'',Estatus:'', Fecha: ''});
              this.fetchTasks();
            })
            .catch(err => console.error(err));
        }
    
      }
    
      deleteTask(id) {
        if(confirm('Seguro que quieres eliminar esta solicitud?')) {
          fetch(`/api/tasks/${id}`, {
            method: 'DELETE',
            headers: {
              'Accept': 'application/json',
              'Content-Type': 'application/json'
            }
          })
            .then(res => res.json())
            .then(data => {
              console.log(data);
              M.toast({html: 'Solicitud Eliminada'});
              this.fetchTasks();
            });
        }
      }
    
      editTask(id) {
        fetch(`/api/tasks/${id}`)
          .then(res => res.json())
          .then(data => {
            
            this.setState({
              Nombre: data.Nombre,
              Cedula: data.Cedula,
              Telefono: data.Telefono,
              Email: data.Email,
              Servicio: data.Servicio,
              Estatus: data.Estatus,
              Fecha: data.Fecha,     
              _id: data._id
            });
          });
      }
    
      componentDidMount() {
        this.fetchTasks();
      }
    
      fetchTasks() {
        fetch('/api/tasks')
          .then(res => res.json())
          .then(data => {
            this.setState({tasks: data});
            console.log(this.state.tasks);
          });
      }
      GenerarPDF(id){
        var imgData = 'data:image/png;base64,'
        
        fetch(`/api/tasks/${id}`)
        .then(res => res.json())
        .then(data => {
          this.setState({
            Nombre: data.Nombre,
              Cedula: data.Cedula,
              Telefono: data.Telefono,
              Email: data.Email,
              Servicio: data.Servicio,
              Estatus: data.Estatus,
              Fecha: data.Fecha,     
              _id: data._id
        
    });
    var doc = new jsPDF()
      doc.setFont('helvetica')
      doc.setFontType('bold')
      doc.text(10,10, 'Fumigaciones Y Servicios DG')
      doc.text(10,20, 'Cabimas, Estado Zulia, Venezuela')
      doc.text(10,30, 'Telefonos: (0265)-6511618 - (0265)-4151032')
      doc.text(10,40, 'RIF: J-31009468-3')

      doc.addImage(imgData, 'JPEG', 140, 10, 60, 30)

      
      
      doc.setLineWidth(0.5)
      doc.line(10, 60, 200, 60)

      doc.setFont('helvetica')
      doc.setFontType('bold')
      doc.text(10,75, 'Datos del Clientes')
      doc.setFontType('normal')
      doc.text(`Nombre: ${this.state.Nombre}`, 10, 85)
      doc.text(`Cedula: ${this.state.Cedula}`, 10, 90)
      doc.text(`Telefono: ${this.state.Telefono}`, 10, 95)
      doc.text(`Email: ${this.state.Email}`, 10, 100)

      
      
      doc.setLineWidth(0.5)
      doc.line(10, 115, 200, 115)
      
      doc.setFont('helvetica')
      doc.setFontType('bold')
      doc.text(10,130, 'Datos de la Solicitud')
      doc.setFontType('normal')
      doc.text(`Fecha de Registro: ${this.state.Fecha}`, 10, 140)
      doc.text(`Servicio: ${this.state.Servicio}`, 10, 145)
      doc.text(`Estatus: ${this.state.Estatus}`, 10, 150)

      doc.text(10,265, 'Se recomienda no compartir este archivo')
      doc.text(10,275, 'Reporte PDF generado por FUMIGACIONES Y SERVICIOS DG')

      doc.save(`${this.state.Cedula}.pdf`)
      window.M.toast({html: 'Descargando Reporte'});
  });
  };
        render(){
            return( 
                  <div>
                         <div className="navbar-fixed ">
                        <nav className="yellow darken-4">
                            <div className="nav-wrapper">
                            <a href="#" data-target="mobile-demo" className="sidenav-trigger"><i className="material-icons">menu</i></a>
                            <ul  className="  hide-on-med-and-down">
                                <li><Link  to="/">Servicios DG</Link></li>
                                <li className="right"><Link  to="/Register">Modificacion y Reportes</Link></li>
                                <li className="right"><Link  to="/Worker">Empleados</Link></li>
                                <li className="right"><Link  to="/Client">Clientes</Link></li>  
                                
                                                       
                            </ul>

                            </div>
                        </nav>
                        </div>
                            <ul className="sidenav" id="mobile-demo">
                                <li><a href="http://localhost:3000/" >Servicios DG</a></li>
                                <li ><Link  to="/Register">Modificacion y Reportes</Link></li>
                                <li ><Link  to="/Worker">Empleados</Link></li>
                                <li ><Link  to="/Client">Clientes</Link></li>   
                            </ul>               

        <div className="container">
         <div className ="col s6"> 
         <h2 style={{textAlign:'center'}}>Registro de Solicitudes</h2>
         <div  className=" card center">
           <div className=" card-content">
              <table style={{marginTop:'25px', marginBottom:'25px'}} className="responsive-table">
                <thead>
                  <tr>
                    <th>Fecha</th>
                    <th>Nombre</th>
                    <th>Cedula</th>
                    <th>Telefono</th>
                    <th>Email</th>
                    <th>Servicio</th>
                    <th>Estatus</th>
                   
                  </tr>
                </thead>
                <tbody>
                  { 
                    this.state.tasks.map(task => {
                      return (
                        <tr key={task._id}>
                          <td>{task.Fecha}</td>
                          <td>{task.Nombre}</td>
                          <td>{task.Cedula}</td>
                          <td>{task.Telefono}</td>
                          <td>{task.Email}</td>
                          <td>{task.Servicio}</td>
                          <td>{task.Estatus}</td>
                          <td>
                            <button title="Eliminar " onClick={() => this.deleteTask(task._id)}style={{margin:"4px"}} className="btn light-blue darken-4 ">
                              <i className="material-icons">delete</i> 
                            </button>
                            <button title="Editar" href="#modal" onClick={() => this.editTask(task._id)} style={{margin:"4px"}}  className="btn light-blue darken-4 modal-trigger " >
                              <i className="material-icons">edit</i>
                              </button>
                              <button title="Generar PDF" onClick={() => this.GenerarPDF(task._id)} style={{margin:"4px"}} className="btn light-blue darken-4" >
                                 <i className="material-icons">picture_as_pdf</i>
                                </button>
                      
                              
                              </td>
                        </tr>
                      )
                    })
                  }
                </tbody>
              </table>
              <br/><br/>
              </div>
                </div>
                <button title="Añadir" href="#modal3"  className="btn light-blue darken-4 modal-trigger " >
                              <i className="material-icons">add</i>
                              </button>
                              <br/><br/>   
                              <br/><br/>   


                              <div id="modal3" className="modal">
                <div className="modal-content">
                  <center><h4>Registro</h4></center>
             
              
             <div className="card"> 
             <div className="card-content center">
             <form action='/enviar' onSubmit={this.addTask}>
                    <div className="row">
                      <div className="input-field col s6">                    
                        <input   name="Nombre" onChange={this.handleChange} value={this.state.Nombre} required={true} placeholder="Nombre o  Empresa" type="text"  autoFocus/>                      
                      </div>
                      <div className="input-field col s6">
                        <textarea  name="Cedula" onChange={this.handleChange} value={this.state.Cedula} required={true} placeholder="Cedula o RIF" type="number" cols="30" rows="10"  className="materialize-textarea"></textarea>
                        
                      </div>
                    </div>

                    <div className="row">
                      <div className="input-field col s6">
                        <textarea name="Telefono" onChange={this.handleChange} value={this.state.Telefono} required={true} placeholder="Telefono" type="number" cols="30" rows="10"  className="materialize-textarea"></textarea>
                        
                      </div>              
                      <div className="input-field col s6">
                        <textarea name="Email" onChange={this.handleChange} value={this.state.Email} required={true} placeholder="Email" type="email" cols="30" rows="10"  className="materialize-textarea"></textarea>
                        
                      </div>
                    </div>
                    <div className="row">
                    <div className="input-field col s6">
                    <select required={true} name="Servicio"  value={this.state.Servicio} onChange={this.handleChange}>
                       <option>Servicio</option>
                         <option>Control Roedores</option>
                          <option>Control Palomas</option>
                           <option>Control Ofidios</option>
                             <option>Control Chiripas</option>
                             <option>Control Plagas Voladoras</option>
                             <option>Servicios Electricos</option>
                             <option>Servicio Pintura General</option>
                             <option>Matenimiento de Areas Verdes</option>
                        </select>                                                                                       
                        
                             </div>             
                      
                      
                        <div className="input-field col s6">
                    <select required={true} name="Estatus"  value={this.state.Estatus} onChange={this.handleChange}>
                       <option>Estatus</option>
                         <option>Completado</option>
                          <option>Pendiente</option>
                          <option>Rechazado</option>
                             
                        </select>                                                                                       
                       
                        </div>              
                        
                      </div> 
                      <button title="Registrar" required={true} type="submit" className="btn light-blue darken-4 "> Registrar</button>
                  </form>
                  </div>
                  </div>
                  <div className="modal-footer">
                    <a href="#!" className="modal-close waves-effect waves-green btn-flat modal-close ">Cerrar</a>
                  </div>
            </div>
           
            
           </div>

















              <div id="modal" className="modal">
                <div className="modal-content">
                  <center><h4>Modificacion</h4></center>
             
              
             <div className="card"> 
             <div className="card-content center">
             <form action='/enviar' onSubmit={this.addTask}>
                    <div className="row">
                      <div className="input-field col s6">                    
                        <input   name="Nombre" required={true} onChange={this.handleChange} value={this.state.Nombre} placeholder="Nombre o  Empresa" type="text"  autoFocus/>                      
                      </div>
                      <div className="input-field col s6">
                        <textarea  name="Cedula" required={true} onChange={this.handleChange} value={this.state.Cedula} placeholder="Cedula o RIF" type="number" cols="30" rows="10"  className="materialize-textarea"></textarea>
                        
                      </div>
                    </div>

                    <div className="row">
                      <div className="input-field col s6">
                        <textarea name="Telefono" required={true} onChange={this.handleChange} value={this.state.Telefono} placeholder="Telefono" type="number" cols="30" rows="10"  className="materialize-textarea"></textarea>
                        
                      </div>              
                      <div className="input-field col s6">
                        <textarea name="Email" required={true} onChange={this.handleChange} value={this.state.Email} placeholder="Email" type="email" cols="30" rows="10"  className="materialize-textarea"></textarea>
                        
                      </div>
                    </div>
                    <div className="row">
                    <div className="input-field col s6">
                    <select name="Servicio" required={true}  value={this.state.Servicio} onChange={this.handleChange}>
                       <option>Servicio</option>
                         <option>Control Roedores</option>
                          <option>Control Palomas</option>
                           <option>Control Ofidios</option>
                             <option>Control Chiripas</option>
                             <option>Control Plagas Voladoras</option>
                             <option>Servicios Electricos</option>
                             <option>Servicio Pintura General</option>
                             <option>Matenimiento de Areas Verdes</option>
                        </select>                                                                                       
                        
                             </div>             
                      
                      
                        <div className="input-field col s6">
                    <select name="Estatus" required={true} value={this.state.Estatus} onChange={this.handleChange}>
                       <option>Estatus</option>
                         <option>Completado</option>
                          <option>Pendiente</option>
                          <option>Rechazado</option>
                             
                        </select>                                                                                       
                       
                        </div>              
                        
                      </div> 
                      <button title="Modificar" type="submit" className="btn light-blue darken-4  "> Modificar </button>
                  </form>
                  </div>
                  </div>
              
            </div>
            <div className="modal-footer">
                    <a href="#!" className="modal-close waves-effect waves-green btn-flat modal-close ">Cerrar</a>
                  </div>
            
           </div>

              



             
                
                
              </div>
              </div>
              <Calendar/>
            <Footer/>
            
            
</div>
              
  
                

         




            );
        }  
    }
  
    export default Admin;